import React from "react";
import { Link } from "react-scroll";

function TopContent() {
  return (
    <div className="topContent">
      <div className="topContnet__container">
        <h1 className="">Pradeep Ragahvan</h1>
        <p>
          Entrepreneurial spirit and unwavering work ethic allow him to see
          opportunities where others see obstacles, making him a force to be
          reckoned with in any industry.
        </p>
        <a>
          <button>Download CV</button>
        </a>
        <Link to="projects" smooth={true} duration={500}>
          <button>My Work</button>
        </Link>
      </div>
    </div>
  );
}

export default TopContent;
